import React from "react";
import "bootstrap-icons/font/bootstrap-icons.css";
import samboLogo from "../assets/samboLogo.PNG";
import { BsFileCode } from "react-icons/bs";
import workLogo from "../assets/briefcase.svg";
import aboutMeLogo from "../assets/file-earmark-person.svg";
import contactLogo from "../assets/phone.svg";

function Header() {
  return (
    <header className="header">
      <div id="headerInfo">
        <p id="headerIntro">
          I <span style={{ color: "#00bfff" }}>'</span> M
        </p>
        <p id="headerName">SAM</p>
        <p id="headerTitle">
          <b>FULL STACK SOFTWARE DEVELOPER</b>
        </p>
      </div>
      <div id="headerCircle">
        <img
          id="samboLogo"
          src={samboLogo}
          alt="cartoon logo of Sam LaChapelle"
        />
      </div>
      <div id="navBar">
        <BsFileCode
          className="navBarIcons"
          style={{ color: "#ffffff", minHeight: "2.25em", minWidth: "2.25em" }}
        />
        <img
          className="navBarIcons"
          style={{ color: "#ffffff", minHeight: "2.25em", minWidth: "2.25em" }}
          src={workLogo}
          alt="work navigation button"
        />
        <img
          className="navBarIcons"
          style={{ color: "#ffffff", minHeight: "2.25em", minWidth: "2.25em" }}
          src={aboutMeLogo}
          alt="about me navigation button"
        />
        <img
          className="navBarIcons"
          style={{ color: "#ffffff", minHeight: "2.25em", minWidth: "2.25em" }}
          src={contactLogo}
          alt="contact navigation button"
        />
      </div>
    </header>
  );
}

export default Header;
